template <typename T>
void compute_geometry_tensor(const T *restrict coords, T G[3][3])
{
  // Quadrature independent code
  // FLOPS: 9 * 2
  T J[9] = {0};
  J[0] = coords[1] - coords[0];
  J[1] = coords[2] - coords[0];
  J[2] = coords[3] - coords[0];
  J[3] = coords[5] - coords[4];
  J[4] = coords[6] - coords[4];
  J[5] = coords[7] - coords[4];
  J[6] = coords[9] - coords[8];
  J[7] = coords[10] - coords[8];
  J[8] = coords[11] - coords[8];

  // Determinant of jacobian
  // FLOPS: 3 * 4
  T detJ = {0};
  detJ += J[0] * (J[4] * J[8] - J[5] * J[7]);
  detJ -= J[1] * (J[3] * J[8] - J[6] * J[5]);
  detJ += J[2] * (J[3] * J[7] - J[6] * J[4]);

  // FLOPS : 9 * 5 * ip
  T invJ[3][3] = {{0}};
  invJ[0][0] = (J[4] * J[8] - J[5] * J[7]);
  invJ[0][1] = (J[2] * J[7] - J[1] * J[8]);
  invJ[0][2] = (J[1] * J[5] - J[2] * J[4]);
  invJ[1][0] = (J[5] * J[6] - J[3] * J[8]);
  invJ[1][1] = (J[0] * J[8] - J[2] * J[6]);
  invJ[1][2] = (J[2] * J[3] - J[0] * J[5]);
  invJ[2][0] = (J[3] * J[7] - J[4] * J[6]);
  invJ[2][1] = (J[1] * J[6] - J[0] * J[7]);
  invJ[2][2] = (J[0] * J[4] - J[1] * J[3]);

  // invJ^T * invJ * detJ
  G[0][0] = (invJ[0][0] * invJ[0][0] + invJ[1][0] * invJ[1][0] + invJ[2][0] * invJ[2][0]) / detJ;
  G[0][1] = (invJ[0][0] * invJ[0][1] + invJ[1][0] * invJ[1][1] + invJ[2][0] * invJ[2][1]) / detJ;
  G[0][2] = (invJ[0][0] * invJ[0][2] + invJ[1][0] * invJ[1][2] + invJ[2][0] * invJ[2][2]) / detJ;

  G[1][0] = (invJ[0][1] * invJ[0][0] + invJ[1][1] * invJ[1][0] + invJ[2][1] * invJ[2][0]) / detJ;
  G[1][1] = (invJ[0][1] * invJ[0][1] + invJ[1][1] * invJ[1][1] + invJ[2][1] * invJ[2][1]) / detJ;
  G[1][2] = (invJ[0][1] * invJ[0][2] + invJ[1][1] * invJ[1][2] + invJ[2][1] * invJ[2][2]) / detJ;

  G[2][0] = (invJ[0][2] * invJ[0][0] + invJ[1][2] * invJ[1][0] + invJ[2][2] * invJ[2][0]) / detJ;
  G[2][1] = (invJ[0][2] * invJ[0][1] + invJ[1][2] * invJ[1][1] + invJ[2][2] * invJ[2][1]) / detJ;
  G[2][2] = (invJ[0][2] * invJ[0][2] + invJ[1][2] * invJ[1][2] + invJ[2][2] * invJ[2][2]) / detJ;
}

